import { Component } from '@angular/core';
import { LocalStorageService } from './data/local-storage';
import { v4 } from 'uuid';
import { ProfileService } from './repository/profile-repository';
import { TrackService } from './repository/track-repository';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'mmf-poc';

  constructor(private localstorageService: LocalStorageService, private profileService: ProfileService, private trackService: TrackService) {
    this.localstorageService.init().then(() => {
      console.log("Created RxDB collections!")
    })
  }

  public async addItem(name:string) {
    this.profileService.post({
      id: v4(),
      name: name,
      done: true,
      timestamp: Date.now(),
    }).then(() => {
      console.log("Added item")
    });
  }

  public async fetchTracks() {
    this.trackService.get$().subscribe(changeEvent => console.dir(changeEvent));
  }
}
